window.bookSummaryJSON = "<p><b>Sometimes you have to fight for what you want. Or risk losing everything you love....</b></p> <p>For elite Strike Team 2 soldier Noah Cross, everything is easy. Hell, that’s his call sign. <i>Easy.</i></p> <p>But when he inherits a two-year-old baby girl, nothing is easy anymore. He can’t care for a toddler while going on dangerous missions to protect his country—and quitting isn’t an option for a man who lives and breathes the military.</p> <p>What Easy needs is a nanny. And he knows just who to ask.</p> <p>Jenna Lane’s luck is running out. She witnessed something she shouldn’t, and she’s been running since. She keeps moving, keeps working odd jobs and trying to survive.</p> <p>After she’s fired from her current job, her situation is desperate. Until the man she’s secretly drawn to offers her a lifeline. She can’t say no, even if saying yes puts him and his little girl at risk.</p> <p>But as the feelings between them grow, Jenna knows she needs the courage to tell Noah the truth. Before a killer strikes again....</p> <p><i>Start listening to the </i><b><i>Hostile Operations Team Series - Strike Team 2</i></b><i> today and enjoy an action-packed, seriously romantic, and steamy-good-fun military romantic suspense. Each book can be enjoyed as a stand-alone. No cliff-hangers or cheating and a guaranteed happily-ever-after ending!</i></p>"; 
